           ['Uncommon',
            [['Metabolism',
              u'och har framf\xf6r allt rapporterats vid anv\xe4ndning av Victoza i kombination med en sulfonureid (0,02 fall/patient\xe5r). Mycket f\xe5 fall (0,001 fall/patient\xe5r) rapporterades vid administrering av Victoza i kombination med andra orala diabetesl\xe4kemedel \xe4n sulfonureider. Gastrointestinala biverkningar Vid kombination av Victoza med metformin rapporterade 20,7% av patienterna minst en episod av illam\xe5ende och 12,6% av patienterna rapporterade minst en episod av diarr\xe9. Vid kombination av Victoza med en sulfonureid rapporterade 9,1% av patienterna minst en episod av illam\xe5ende och 7,9% av patienterna rapporterade minst en episod av diarr\xe9. De flesta episoderna var l\xe4tta till m\xe5ttliga och dosberoende. Vid fortsatt behandling minskade frekvensen och sv\xe5righetsgraden f\xf6r de flesta patienter som i b\xf6rjan upplevde illam\xe5ende. Patienter >70 \xe5r kan uppleva mer biverkningar i magtarmkanalen vid behandling med liraglutid. Patienter med lindrigt nedsatt njurfunktion (kreatininclearance 60\u201390 ml/min) kan uppleva mer biverkningar i magtarmkanalen vid behandling med liraglutid. Avbruten behandling Incidensen av avbruten behandling p\xe5 grund av biverkningar var 7,8% f\xf6r patienter som behandlades med Victoza och 3,4% f\xf6r patienter som behandlades med ett j\xe4mf\xf6relsel\xe4kemedel i de kontrollerade l\xe5ngtidsstudierna (26 veckor eller l\xe4ngre). De vanligaste biverkningarna som ledde till avbruten behandling f\xf6r patienter som behandlades med Victoza var illam\xe5ende (2,8% av patienterna) och kr\xe4kningar (1,5%). 7 Immunogenicitet L\xe4kemedel som inneh\xe5ller proteiner eller peptider har potentiellt immunogena egenskaper och d\xe4rmed kan patienter utveckla antikroppar mot liraglutid efter behandling med Victoza. I genomsnitt utvecklade 8,6% av patienterna antikroppar. Bildandet av antikroppar har inte f\xf6rknippats med f\xf6rs\xe4mrad effekt av Victoza. Ett f\xe5tal fall (0,05%) av angio\xf6dem har rapporterats i alla l\xe5ngtidsstudier med Victoza. Reaktioner vid injektionsst\xe4llet Reaktioner vid injektionsst\xe4llet har rapporterats hos cirka 2% av de patienter som behandlats med Victoza vid kontrollerade l\xe5ngtidsstudier (26 veckor eller l\xe4ngre). Dessa reaktioner har vanligtvis varit lindriga. Pankreatit Ett f\xe5tal fall (<0,2%) av akut pankreatit har rapporterats i l\xe5ngtidsstudier med Victoza. Pankreatit har \xe4ven rapporterats efter marknadsf\xf6ring. Biverkningar relaterade till sk\xf6ldk\xf6rteln Den sammantagna incidensen av sk\xf6ldk\xf6rtelbiverkningar i medell\xe5nga studier och l\xe5ngtidsstudier var 33,5; 30,0 och 21,7 biverkningar per 1 000 patient\xe5r f\xf6r liraglutid, placebo resp. j\xe4mf\xf6relsel\xe4kemedel, varav 5,4; 2,1 resp. 1,2 utg\xf6r allvarliga biverkningar. De vanligaste sk\xf6ldk\xf6rtelbiverkningarna var sk\xf6ldk\xf6rtelneoplasier, f\xf6rh\xf6jd kalcitoninniv\xe5 i blodet och struma. Incidensen per 1 000 patient\xe5r f\xf6r patienter behandlade med liraglutid var 6,8; 10,9 och 5,4 j\xe4mf\xf6rt med 6,4; 10,7 och 2,1 f\xf6r patienter behandlade med placebo respektive 2,5; 6,0 och 1,8 f\xf6r patienter behandlade med j\xe4mf\xf6relsel\xe4kemedel. Allergiska reaktioner Allergiska reaktioner inklusive urticaria, hudutslag och kl\xe5da har rapporterats efter att Victoza godk\xe4nts f\xf6r f\xf6rs\xe4ljning. Ett f\xe5tal fall av anafylaktiska reaktioner med \xe4ven andra symtom s\xe5som hypotoni, hj\xe4rtklappning, andn\xf6d och \xf6dem har rapporterats efter att Victoza godk\xe4nts f\xf6r f\xf6rs\xe4ljning.']]],
